import React from "react";
import logo from "./media/m.png"
import resume from "./media/resume.pdf"

function Navbar() {
  return (
        <div class="sticky-top navbar justify-content-between p-3" style={{backgroundColor: "#343A40", position: "relative", top: 0}} id="navbar">
            <span class="d-flex align-items-center">
                <a href="/"><img src={logo} alt="m" class="mr-1" style={{width: "35px"}}/></a>
                <a href="/" class="text-brand my-auto" style={{textDecoration: "none"}}>Max Pinheiro</a>
            </span>
            <div class="">
                <a href="/about" class="text-heading mx-2 my-auto" style={{textDecoration: "none"}}>about</a>
                <a href="/projects" class="text-heading mx-2 my-auto" style={{textDecoration: "none"}}>projects</a>
                <a href="/portfolio" class="text-heading mx-2 my-auto" style={{textDecoration: "none"}}>portfolio</a>
                <a href="https://github.com/maxpinheiro" class="text-heading mx-2 my-auto" style={{textDecoration: "none"}} target="_blank" rel="noopener noreferrer">github</a>
                <a href={resume} class="text-heading mx-2 my-auto" style={{textDecoration: "none"}} target="_blank" rel="noopener noreferrer">resume</a>
                <a href="/contact" class="text-heading mx-2 my-auto" style={{textDecoration: "none"}}>contact</a>
            </div>
        </div>
  );
}

export default Navbar;
